    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT 95 BETWEEN + 39 AND ( - - ( + - 60 ) * col0 + + col2 * + col1 );
  - name: tab2

outputs:
  - name: q2162.out
    data: |
      46	51	23
      64	77	40
      75	67	58
